{
  "translationLines": [
    {
      "lineNumber": 78141,
      "originalJapaneseLine": "　俺はどうして無事だったんだ？」",
      "translatedEnglishLine": "\"Why was I unharmed?\""
    },
    {
      "lineNumber": 78142,
      "originalJapaneseLine": "「勝つことこそ出来なかったが、",
      "translatedEnglishLine": "\"Although we couldn't win,"
    },
    {
      "lineNumber": 78143,
      "originalJapaneseLine": "　レッドアイを大分追い詰められたからな」",
      "translatedEnglishLine": "we managed to corner Red Eye quite a bit.\""
    },
    {
      "lineNumber": 78144,
      "originalJapaneseLine": "「ふふん、それでサテラもお前を",
      "translatedEnglishLine": "\"Hmph, that's why Satella was able to"
    },
    {
      "lineNumber": 78145,
      "originalJapaneseLine": "　引っ張って逃げられたんだ」",
      "translatedEnglishLine": "pull you away and escape.\""
    },
    {
      "lineNumber": 78146,
      "originalJapaneseLine": "「兄様が戦ってくれたおかげで、",
      "translatedEnglishLine": "\"Thanks to older brother fighting for us,"
    },
    {
      "lineNumber": 78147,
      "originalJapaneseLine": "　ランス城の撤退もスムーズに進みました」",
      "translatedEnglishLine": "the withdrawal from Rance Castle proceeded smoothly.\""
    },
    {
      "lineNumber": 78148,
      "originalJapaneseLine": "「参謀の方々の指示もすごかったです。",
      "translatedEnglishLine": "\"The staff officers' instructions were amazing as well."
    },
    {
      "lineNumber": 78149,
      "originalJapaneseLine": "　すごく的確で……",
      "translatedEnglishLine": "Very precise..."
    },
    {
      "lineNumber": 78150,
      "originalJapaneseLine": "　それに何よりも……」",
      "translatedEnglishLine": "And above all...\""
    },
    {
      "lineNumber": 78151,
      "originalJapaneseLine": "「ええ、ビスケッタさんが最後まで",
      "translatedEnglishLine": "\"Yes, Biscetta-san stood in the forefront"
    },
    {
      "lineNumber": 78152,
      "originalJapaneseLine": "　矢面に立ち城を守ってくれましたからね……」",
      "translatedEnglishLine": "until the end protecting the castle...\""
    },
    {
      "lineNumber": 78153,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 78154,
      "originalJapaneseLine": "「うん？」",
      "translatedEnglishLine": "\"Hm?\""
    },
    {
      "lineNumber": 78155,
      "originalJapaneseLine": "かすかに重くなった場の空気を振り払うように、",
      "translatedEnglishLine": "As if shaking off the slightly heavy atmosphere,"
    },
    {
      "lineNumber": 78156,
      "originalJapaneseLine": "香姫がすぐに顔を上げて説明を続ける。",
      "translatedEnglishLine": "Kouhime immediately raised her face and continued explaining."
    },
    {
      "lineNumber": 78157,
      "originalJapaneseLine": "「これが二日前の顛末です」",
      "translatedEnglishLine": "\"This is what happened two days ago.\""
    },
    {
      "lineNumber": 78158,
      "originalJapaneseLine": "「ああ。で、ランス城から撤退した俺達は",
      "translatedEnglishLine": "\"Ah, so after withdrawing from Rance Castle,"
    },
    {
      "lineNumber": 78159,
      "originalJapaneseLine": "　このJAPANは織田城まで引っ込んだ……",
      "translatedEnglishLine": "we pulled back this JAPAN to Oda Castle..."
    },
    {
      "lineNumber": 78160,
      "originalJapaneseLine": "　ってわけか」",
      "translatedEnglishLine": "That's how it is.\""
    },
    {
      "lineNumber": 78161,
      "originalJapaneseLine": "「はい、そうです。",
      "translatedEnglishLine": "\"Yes, that's right."
    },
    {
      "lineNumber": 78162,
      "originalJapaneseLine": "　ここが人類軍の新しい拠点となります」",
      "translatedEnglishLine": "This has become the new base for the Humanity Army.\""
    },
    {
      "lineNumber": 78163,
      "originalJapaneseLine": "「……前線を下げられちまったな」",
      "translatedEnglishLine": "\"...We've had to retreat the front lines.\""
    },
    {
      "lineNumber": 78164,
      "originalJapaneseLine": "「ランス城に何かあったときの",
      "translatedEnglishLine": "\"There had been talk for some time"
    },
    {
      "lineNumber": 78165,
      "originalJapaneseLine": "　もしもの最終防衛地点にしようという話は",
      "translatedEnglishLine": "about making this a final defensive point"
    },
    {
      "lineNumber": 78166,
      "originalJapaneseLine": "　以前からあったんです」",
      "translatedEnglishLine": "in case something happened to Rance Castle.\""
    },
    {
      "lineNumber": 78167,
      "originalJapaneseLine": "「ここは以前、兄様がJAPANの戦争中に",
      "translatedEnglishLine": "\"This place was previously used by older brother"
    },
    {
      "lineNumber": 78168,
      "originalJapaneseLine": "　使用していたのもあって、",
      "translatedEnglishLine": "during the JAPAN war,"
    },
    {
      "lineNumber": 78169,
      "originalJapaneseLine": "　使いやすいでしょうし……」",
      "translatedEnglishLine": "so it should be easy to use...\""
    },
    {
      "lineNumber": 78170,
      "originalJapaneseLine": "「左様、大陸の方々の為に、",
      "translatedEnglishLine": "\"Indeed, for the people of the continent,"
    },
    {
      "lineNumber": 78171,
      "originalJapaneseLine": "　城内の改造も行いました」",
      "translatedEnglishLine": "we also made renovations inside the castle.\""
    },
    {
      "lineNumber": 78172,
      "originalJapaneseLine": "「まずはランス殿の部屋」",
      "translatedEnglishLine": "\"First, Lord Rance's room,"
    },
    {
      "lineNumber": 78173,
      "originalJapaneseLine": "「それから、総統司令部も",
      "translatedEnglishLine": "\"Then, we also created a headquarters for the Supreme Commander,"
    },
    {
      "lineNumber": 78174,
      "originalJapaneseLine": "　場所を設けて作りました故、",
      "translatedEnglishLine": "a place prepared for it,"
    },
    {
      "lineNumber": 78175,
      "originalJapaneseLine": "　参謀の方々はそちらに」",
      "translatedEnglishLine": "so the staff officers are there.\""
    },
    {
      "lineNumber": 78176,
      "originalJapaneseLine": "「玉座の間に――」",
      "translatedEnglishLine": "\"In the throne room—"
    },
    {
      "lineNumber": 78177,
      "originalJapaneseLine": "「ランス殿のお子の為の",
      "translatedEnglishLine": "\"There's even a nursery"
    },
    {
      "lineNumber": 78178,
      "originalJapaneseLine": "　保育園だってありますぞ×３」",
      "translatedEnglishLine": "for Lord Rance's children, times three.\""
    },
    {
      "lineNumber": 78179,
      "originalJapaneseLine": "「あ、子供達も全員、",
      "translatedEnglishLine": "\"Ah, all the children too,"
    },
    {
      "lineNumber": 78180,
      "originalJapaneseLine": "　千姫さんが無事に連れてきてくれました。",
      "translatedEnglishLine": "Senhime-san safely brought them here."
    },
    {
      "lineNumber": 78181,
      "originalJapaneseLine": "　安心して下さい、ランス様」",
      "translatedEnglishLine": "Please rest assured, Lord Rance.\""
    },
    {
      "lineNumber": 78182,
      "originalJapaneseLine": "「それに、魔人討伐隊の被害はありません。",
      "translatedEnglishLine": "\"Moreover, there was no damage to the demon extermination squad."
    },
    {
      "lineNumber": 78183,
      "originalJapaneseLine": "　また以前のようにここから戦うことは",
      "translatedEnglishLine": "It seems it's still possible to fight from here as before."
    },
    {
      "lineNumber": 78184,
      "originalJapaneseLine": "　可能だそうです」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 78185,
      "originalJapaneseLine": "「ふむふむ」",
      "translatedEnglishLine": "\"I see, I see.\""
    },
    {
      "lineNumber": 78186,
      "originalJapaneseLine": "「で、魔軍の動きはどうなっとる。",
      "translatedEnglishLine": "\"So, what are the demon army's movements like?"
    },
    {
      "lineNumber": 78187,
      "originalJapaneseLine": "　ここに俺らがいるのはバレてるだろう」",
      "translatedEnglishLine": "They must know we're here, right?\""
    },
    {
      "lineNumber": 78188,
      "originalJapaneseLine": "「はい、そうですね。",
      "translatedEnglishLine": "\"Yes, that's correct."
    },
    {
      "lineNumber": 78189,
      "originalJapaneseLine": "　ですが……",
      "translatedEnglishLine": "However...\""
    },
    {
      "lineNumber": 78190,
      "originalJapaneseLine": "「そんな時の為に俺達がいる」",
      "translatedEnglishLine": "\"That's what we're here for.\""
    }
  ]
}

